import { prefix } from '../../globals';

function Button ({ href, children, ...props }) {

  const Comp = href ? 'a' : 'button';

  return (
    <Comp href={href} className={`${prefix}-btn`} {...props}>
      {children}
    </Comp>
  );
}

export default Button;
